import React, { useState } from 'react';
import './App.css';

import Users from './components/Users';

const App = () => {
  const [users, setUsers] = useState([
    {
      id: '1',
      name: 'Gabriel',
      email: 'g@gmail.com',
      website: 'www.g.com.br'
    },
    {
      id: '2',
      name: 'Luna',
      email: 'l@gmail.com',
      website: 'www.l.com.br'
    }
  ]);
  return (
    <div className='container'>
      <Users />
    </div>
  );
};

export default App;
